import React from "react";
export default function Nav() {

    return(
        <>
            <div className="nav-logo">
                <a href="App.js" className="logo"></a>
                <div className="nav">
                    <button>+</button>
                    <input type="text" placeholder="szukaj"/>
                </div>
            </div>
        </>
    )
};
